import React, {Component} from 'react';
import Img from 'react-image'

class Home extends Component {
    render() {
        const divStyle = {
            backgroundImage : "sky-space.jpg"

        };

        return (
            <div style={divStyle}>
                <div>
                    <Img src={'./profile.jpg'} style={{}} width="128px"/>
                    <h2>Alper Tunca</h2>
                    <h3>Student Developer</h3>
                </div>

                <h2>Hi, I'm Alper Tunca</h2>
                I'm a senior in electrical and electronics engineering. I am trying to prove myself by learning many programming languages. I participate in many events and competitions alone or with my team.

                I develop projects mostly with JavaScript using React, Node and with Java using Android. I also design basic circuit boards.

            </div>
        );
    }
}

export default Home;
